import About from "./About";

import ContactUs from "./ContactUs";
import Hero from "./Hero";
import IncreaseSale from "./IncreaseSale";

function Homepage() {
    return (
        <>
            <section>
                <Hero />
                <IncreaseSale />
                <About/>
                <ContactUs />
            </section>
        </>
    );
}

export default Homepage;
